def switches(n, m, a):
    for i in range(n):
        for j in range(m):
            if a[i][j] == 1:
                for k in range(m):
                    if a[i][k] == 1 and k != j:
                        a[i][k] = 0
    for i in range(m):
        if a[n - 1][i] == 0:
            return "NO"
    return "YES"

